import React from 'react';
import './Background.css';

function Background() {
    return (
        <div className='background__container'>
            <div className='background__left'>

            </div>
            <div className='background__rightInfo'>
                <h3> Background </h3>
                <p> With a history of over 30 years in the industry, Apex Insurance has extensive knowledge and understanding of the region’s diversity, enabling us to deliver unique insights and advices that help fulfill client’s insurance needs. </p>
            </div>
        </div>
    )
}

export default Background
